import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PipelineTransformation from './components/PipelineSimulation';
import EditPage from './components/EditPage';
import AssetOverview from './components/AssetOverview';

const App = () => {
    return (
        <Router>
            <div>
                <h1>Asset Tracking and Pipeline Transformation</h1>
                <Switch>
                    <Route exact path="/" component={PipelineTransformation} />
                    <Route path="/edit" component={EditPage} />
                    <Route path="/overview" component={AssetOverview} />
                </Switch>
            </div>
        </Router>
    );
};

export default App;
